import React from 'react';
import s from '../../../scss/MyHabits/MyHabitsDesktop.module.scss'

function MyHabitsDesktop(props) {
    return (
        <div className={s.wrapper}>
            <div>
                <div className={s.nav}>
                    Nav
                </div>
                <div className={s.field}>
                    Field
                </div>
            </div>
        </div>
    );
}

export default MyHabitsDesktop;
